export default function Skills() {
  const spheres = ["language", "framework"]; // Types of spheres

  useEffect(() => {
    spheres.forEach((type) => {
      const sphere = document.querySelector(
        `.sphere-${type}`
      ) as HTMLElement | null;
      const icons = document.querySelectorAll(`.icon-${type}`);

      let angle = 0;
      const speed = 0.05;
      const totalIcons = icons.length;
      const angleIncrement = 360 / totalIcons;

      icons.forEach((icon, index) => {
        const currentAngle = index * angleIncrement;
        if (icon instanceof HTMLElement) {
          icon.style.transform = `rotateY(${currentAngle}deg) translateZ(300px)`; // Wider circle with increased Z value
        }
      });

      function rotateSphere() {
        if (sphere) {
          angle += speed;
          sphere.style.transform = `rotateY(${angle}deg)`;
        }
        requestAnimationFrame(rotateSphere);
      }

      rotateSphere();
    });
  }, []);

  return (
    <div className="skills-container mt-10">
      <h3 className="text-2xl md:text-3xl font-bold mb-4 text-center">
        Tech Stacks
      </h3>

      {spheres.map((type) => (
        <div key={type} className="sphere-container">
          <h4 className="text-xl font-bold text-center capitalize">
            {type === "language" ? "Languages" : "Frameworks and Tools"}
          </h4>
          <div className={`sphere sphere-${type}`}>
            {techStacks
              .filter((skill) => skill.type === type)
              .map((skill, index) => (
                <div key={index} className={`icon icon-${type}`}>
                  <img src={skill.logo} alt={skill.name} />
                  <p>{skill.name}</p>
                </div>
              ))}
          </div>
        </div>
      ))}
    </div>
  );
}
